import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <div className="header-content">
        <h2 className="conference-type">Two Days National E-Conference on</h2>
        <h1 className="conference-title">
          Applications of Emerging Technologies in Science and Innovations
          <span className="conference-code">(AETSI-2025)</span>
        </h1>
        <div className="organizer-info">
          <p><strong>Organised by:</strong> School of Engineering and Technology</p>
          <p><strong>Sponsored by:</strong> RAFFLES UNIVERSITY, Neemrana</p>
        </div>
        <div className="conference-dates">Date: 10th - 11th March 2025</div>
        <Link to="/register" className="register-btn">Register Now</Link>
      </div>
    </header>
  );
};

export default Header;
